// using addition (+) with strings concatenates them
console.log("node" + "js");

// you can print numbers directly to console without explicit type coercion
console.log("1 + 1 =", 1+1);
console.log("7.0 / 3.0 =", 7.0/3.0);

// booleans work as expected
console.log(true && false);
console.log(true || false);
console.log(!true);
